```
+REGISTER(BinaryOp, CPU, "NotEqual", functor::not_equal_to, float);
+REGISTER(BinaryOp, CPU, "NotEqual", functor::not_equal_to, int32);
+REGISTER(BinaryOp, CPU, "NotEqual", functor::not_equal_to, int64);
```

